import React from "react";
import { Card } from 'antd';
import { ReTweetOutlined, HeartOutlined, MessageOutlined, Popover, EllipsisOutlined } from "@ant-design"
import AppLayout from "./AppLayout";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.Images[0] && <PostImages images={post.Images} />}
      actions={[
        <ReTweetOutlined/>,
        <HeartOutlined/>,
        <MessageOutlined/>,
        <Popover>
          <EllipsisOutlined/>
        </Popover>
      ]}>
        <Image/>
        <Content/>
        <Buttons></Buttons>
      </Card>
      <CommentForm/>
      <Comments/>
    </div>
  )
}

export default PostCard;
